import "./App.css";
import React, { Component } from 'react'

class Topbar extends Component {
    constructor(props) {
        super(props)
        this.state = {
            view : "1"
        }
    }
    
    render() {
        let view= <Day/>;
        if(this.state.view === "2") view= <Week/>
        else if(this.state.view === "3") view= <Month/>
        return props.enter ?
        (
        <React.Fragment>
            <div className="header2">
                <button className="back" onClick={props.back} > BACK </button>
                <select className="viewType" onChange={(e)=>{this.setState({view : e.target.value})}}>
                    <option type="1" > Day </option>
                    <option type="2" > Week </option>
                    <option type="3" > Month </option>
                </select>
            </div>
            {view}
        </React.Fragment>
        )
        :
        (
        <div className="header">
            <div className="headerFont">
                <div className="oneLine">
                    <input
                        placeholder="ðŸ”Ž Search Teacher"
                        className="input"
                        type="text"
                        onChange={props.textChange}
                    />
                </div>
            </div>
        </div>
        );
    }
}

export default Topbar
